DROP TABLE IF EXISTS `Calculation8K`;
CREATE TABLE `Calculation8K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `Structure8K`;
CREATE TABLE `Structure8K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  PRIMARY KEY (`calculation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `Composition8K`;
CREATE TABLE `Composition8K` (
  `entry_id` varchar(50) NOT NULL,
  `calculation_id` varchar(50) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
